import React, { Component } from "react";
import { View, Text, StyleSheet, Style, TouchableOpacity, ImageBackground, Image, Modal } from "react-native";


export default class cadastroUser extends Component{
    constructor(props)
    {
        super(props);
        this.state =
        {
          show : Boolean,
        }
    }

    render()
    {
        return(
            <View style={styles.container}>


                <Modal
                  style={styles.Modal}
                >
                  <Text>testetetetetetete</Text>
                </Modal>

               

            </View>
        )
    }

}

const styles = StyleSheet.create({
    container: {
        flex: 1,
        
      },
    
      imgH1: {
        width: '50%',
        height: '100%',
      },
    
      ctnH1: {
        flex: 0.3,
        backgroundColor: '#00873B',
    
        alignItems: 'center',
        flexDirection: 'row',
      },
      
      TouchH1: {
        width: '20%',
        height: '10%',
        // backgroundColor : 'blue',
    
        justifyContent: 'center',
        alignItems: 'center',
      },
    
      txtH1: {
        fontSize: 25,
        fontWeight: 'bold',
        color: 'white',
      },

      ctnText: {
        flex: 0.05,
        marginTop: 10,
        // backgroundColor: 'green',
        
        justifyContent: 'center',
        alignItems: 'center',
      },

      txtBtn: {
        fontSize: 20,
        fontFamily: 'Arial',
        textDecorationLine: 'underline',
      },

      modalCtn: {
        flex: 1,
        backgroundColor: 'black',
      },

      Modal: {
        borderColor: 'none',
      }

})
